INSERT INTO `b_thing` VALUES (94, '范冰冰', 'e68e9a05-11bc-41c3-a3b2-1b52da261957.jpeg', '该医生是一位资深医学专家，拥有超过15年的临床经验。他毕业于知名医学院，获得内科医学博士学位，并曾在多家著名医院从事临床工作。该医生擅长诊断和治疗各种内科疾病，包括高血压、糖尿病、心脏病等常见疾病。\r\n\r\n该医生以其耐心、细致和敬业的工作态度赢得了患者的信赖和尊重。他始终关注患者的健康状况，针对每位患者的具体情况制定个性化的治疗方案，并在治疗过程中不断进行跟踪和调整，以确保患者能够尽快康复。\r\n\r\n除了在临床工作中表现出色，该医生还积极参与医学教育和学术研究，多次在国内外学术期刊上发表论文，并参加国际学术会议。他不断学习更新医学知识，关注行业最新发展，以提供最优质的医疗服务。\r\n\r\n作为一名医生，他始终将患者的健康放在首位，倡导健康生活方式，为患者提供全面的医疗建议和指导。该医生深受患者喜爱，被认为是一位顶尖的医疗专家和值得信赖的医生。他的细心、耐心和专业精神让患者感受到了医学的温暖和关怀，成为患者心中的良医良师。', '220', '0', 0, '14355552222', '否', '23', '周三,周五,周日', '主治医师', '女', '1686408371137', 3, 6, 0, 0, 0, 1, NULL);
